{
  // This file contains recommended VS Code extensions for this project
  // The 'recommendations' array lists extensions that are suggested for installation
  // Currently recommending the Angular Language Service extension (angular.ng-template)
  // This extension provides rich editing features for Angular templates and TypeScript code
  // For more information, visit: https://go.microsoft.com/fwlink/?linkid=827846
  "recommendations": ["angular.ng-template"]
}

{
  // Visual Studio Code launch configuration file for debugging Angular applications
  // Documentation: https://go.microsoft.com/fwlink/?linkid=830387
  "version": "0.2.0",
  "configurations": [
    {
      // Configuration for debugging the Angular development server
      "name": "ng serve", // Display name in the debug dropdown
      "type": "pwa-chrome", // Debug using Chrome with PWA support
      "request": "launch", // Launch a new browser instance
      "preLaunchTask": "npm: start", // Run 'npm start' before launching
      "url": "http://localhost:4200/" // URL where the app will be served
    },
    {
      // Configuration for debugging Angular unit tests
      "name": "ng test", // Display name in the debug dropdown
      "type": "chrome", // Debug using Chrome
      "request": "launch", // Launch a new browser instance
      "preLaunchTask": "npm: test", // Run 'npm test' before launching
      "url": "http://localhost:9876/debug.html" // Karma test runner URL
    }
  ]
}

{
  // VSCode tasks configuration file version
  "version": "2.0.0",

  // Array of task configurations
  "tasks": [
    {
      // First task: npm start
      "type": "npm",                    // Specifies this is an npm task
      "script": "start",                // The npm script to run
      "isBackground": true,             // Task runs in the background
      "problemMatcher": {
        "owner": "typescript",          // TypeScript is responsible for problem detection
        "pattern": "$tsc",             // Uses TypeScript compiler pattern matching
        "background": {
          "activeOnStart": true,        // Problem matcher is active when task starts
          "beginsPattern": {
            "regexp": "(.*?)"           // Pattern to detect when compilation starts
          },
          "endsPattern": {
            "regexp": "bundle generation complete"  // Pattern to detect when compilation ends
          }
        }
      }
    },
    {
      // Second task: npm test
      "type": "npm",                    // Specifies this is an npm task
      "script": "test",                 // The npm script to run
      "isBackground": true,             // Task runs in the background
      "problemMatcher": {
        "owner": "typescript",          // TypeScript is responsible for problem detection
        "pattern": "$tsc",             // Uses TypeScript compiler pattern matching
        "background": {
          "activeOnStart": true,        // Problem matcher is active when task starts
          "beginsPattern": {
            "regexp": "(.*?)"           // Pattern to detect when compilation starts
          },
          "endsPattern": {
            "regexp": "bundle generation complete"  // Pattern to detect when compilation ends
          }
        }
      }
    }
  ]
}

{
  // Schema definition for Angular CLI configuration
  "$schema": "./node_modules/@angular/cli/lib/config/schema.json",
  // Version number of the configuration format
  "version": 1,
  // Default directory for new projects
  "newProjectRoot": "projects",
  // Project configurations
  "projects": {
    "Frontend": {
      // Defines this as an application project
      "projectType": "application",
      // Default schematics configuration
      "schematics": {
        "@schematics/angular:component": {
          // Sets SCSS as default style format for components
          "style": "scss"
        }
      },
      // Project root directory
      "root": "",
      // Source code root directory
      "sourceRoot": "src",
      // Prefix for component selectors
      "prefix": "app",
      // Build configurations and tools
      "architect": {
        "build": {
          // Angular build configuration
          "builder": "@angular-devkit/build-angular:browser",
          "options": {
            // Output directory for built files
            "outputPath": "dist/frontend",
            // Main HTML file
            "index": "src/index.html",
            // Main TypeScript entry point
            "main": "src/main.ts",
            // Polyfills file for browser compatibility
            "polyfills": "src/polyfills.ts",
            // TypeScript configuration file
            "tsConfig": "tsconfig.app.json",
            // Style preprocessor language
            "inlineStyleLanguage": "scss",
            // Static assets to copy to build output
            "assets": [
              "src/favicon.ico",
              "src/assets"
            ],
            // Global styles
            "styles": [
              "src/styles.scss"
            ],
            // Global scripts
            "scripts": []
          },
          // Environment-specific configurations
          "configurations": {
            "production": {
              // Budget thresholds for bundle sizes
              "budgets": [
                {
                  "type": "initial",
                  "maximumWarning": "500kb",
                  "maximumError": "1mb"
                },
                {
                  "type": "anyComponentStyle",
                  "maximumWarning": "2kb",
                  "maximumError": "4kb"
                }
              ],
              // Environment file replacement for production
              "fileReplacements": [
                {
                  "replace": "src/environments/environment.ts",
                  "with": "src/environments/environment.prod.ts"
                }
              ],
              // Enable output hashing for cache busting
              "outputHashing": "all"
            },
            "development": {
              // Development-specific build options
              "buildOptimizer": false,
              "optimization": false,
              "vendorChunk": true,
              "extractLicenses": false,
              "sourceMap": true,
              "namedChunks": true
            }
          },
          // Default build configuration
          "defaultConfiguration": "production"
        },
        // Development server configuration
        "serve": {
          "builder": "@angular-devkit/build-angular:dev-server",
          "configurations": {
            "production": {
              "browserTarget": "Frontend:build:production"
            },
            "development": {
              "browserTarget": "Frontend:build:development"
            }
          },
          "defaultConfiguration": "development"
        },
        // Internationalization extraction configuration
        "extract-i18n": {
          "builder": "@angular-devkit/build-angular:extract-i18n",
          "options": {
            "browserTarget": "Frontend:build"
          }
        },
        // Testing configuration
        "test": {
          "builder": "@angular-devkit/build-angular:karma",
          "options": {
            "main": "src/test.ts",
            "polyfills": "src/polyfills.ts",
            "tsConfig": "tsconfig.spec.json",
            "karmaConfig": "karma.conf.js",
            "inlineStyleLanguage": "scss",
            "assets": [
              "src/favicon.ico",
              "src/assets"
            ],
            "styles": [
              "src/styles.scss"
            ],
            "scripts": []
          }
        }
      }
    }
  }
}

// Karma configuration file, see link for more information
// https://karma-runner.github.io/1.0/config/configuration-file.html

module.exports = function (config) {
  config.set({
    // Base path that will be used to resolve all patterns (eg. files, exclude)
    basePath: '',

    // Frameworks to be used for testing
    frameworks: ['jasmine', '@angular-devkit/build-angular'],

    // List of plugins required for test execution
    plugins: [
      require('karma-jasmine'),              // Jasmine testing framework integration
      require('karma-chrome-launcher'),       // Chrome browser launcher
      require('karma-jasmine-html-reporter'), // Generates HTML test results
      require('karma-coverage'),              // Code coverage reporter
      require('@angular-devkit/build-angular/plugins/karma') // Angular build integration
    ],

    // Client configuration
    client: {
      jasmine: {
        // Configuration options for Jasmine
        // See: https://jasmine.github.io/api/edge/Configuration.html
        // Examples:
        // random: false - Disable random test execution
        // seed: 4321 - Set specific random seed
      },
      clearContext: false // Keeps Jasmine Spec Runner output visible in browser
    },

    // Configuration for the HTML reporter
    jasmineHtmlReporter: {
      suppressAll: true // Removes duplicate stack traces
    },

    // Configuration for code coverage reporting
    coverageReporter: {
      dir: require('path').join(__dirname, './coverage/frontend'), // Output directory
      subdir: '.',
      reporters: [
        { type: 'html' },      // Generates HTML coverage report
        { type: 'text-summary' } // Generates console summary
      ]
    },

    // Test results reporters to use
    reporters: ['progress', 'kjhtml'],

    // Web server port
    port: 9876,

    // Enable / disable colors in the output (reporters and logs)
    colors: true,

    // Level of logging
    logLevel: config.LOG_INFO,

    // Enable / disable watching files and executing tests on file changes
    autoWatch: true,

    // Browsers to launch and capture
    browsers: ['Chrome'],

    // Continuous Integration mode
    // If true, Karma captures browsers, runs the tests and exits
    singleRun: false,

    // Restart tests on file changes
    restartOnFileChange: true
  });
};

