import { Injectable } from '@angular/core';
import { CanActivate, Router } from '@angular/router';

/**
 * Authentication Guard Service
 * 
 * This guard is responsible for protecting routes that require authentication.
 * It implements the CanActivate interface to control access to specific routes.
 */
@Injectable({
  providedIn: 'root'
})
export class AuthGuard implements CanActivate {
  /**
   * Constructor for AuthGuard
   * @param router - Angular Router service for navigation
   */
  constructor(private router: Router) {}

  /**
   * Determines if a route can be activated
   * 
   * @returns boolean - true if user is authenticated, false otherwise
   * 
   * This method:
   * 1. Checks if there's a user stored in localStorage
   * 2. If user exists, allows route activation
   * 3. If no user exists, redirects to login page and prevents route activation
   */
  canActivate(): boolean {
    // Check for user data in localStorage
    const user = localStorage.getItem('user');

    // If user exists, allow route activation
    if (user) {
      return true;
    }

    // If no user, redirect to login page and prevent route activation
    this.router.navigate(['/login']);
    return false;
  }
}

