export class ModalComponent implements OnInit, OnDestroy {
  /** Stores the current modal configuration */
  modalConfig: ModalConfig | null = null;

  /** Subscription to handle modal service updates */
  private subscription: Subscription;

  /**
   * @constructor
   * @param modalService - Service for managing modal state
   */
  constructor(private modalService: ModalService) {
    // Subscribe to modal service updates
    this.subscription = this.modalService.modal$.subscribe(
      config => this.modalConfig = config
    );
  }

  /** Lifecycle hook for component initialization */
  ngOnInit(): void {}

  /**
   * Lifecycle hook for component destruction
   * Cleans up subscription to prevent memory leaks
   */
  ngOnDestroy(): void {
    if (this.subscription) {
      this.subscription.unsubscribe();
    }
  }
}

/**
 * Service responsible for managing modal notifications in the application.
 * Uses RxJS Subject to handle modal state and visibility.
 */

import { Injectable } from '@angular/core';
import { Subject } from 'rxjs';

/**
 * Interface defining the configuration for modal messages
 * @interface ModalConfig
 * @property {string} message - The text content to be displayed in the modal
 * @property {'success' | 'error'} type - The type of modal, either success or error
 */
export interface ModalConfig {
  message: string;
  type: 'success' | 'error';
}

@Injectable({
  providedIn: 'root'
})
export class ModalService {
  /**
   * Subject to handle modal state changes
   * @private
   */
  private modalSubject = new Subject<ModalConfig | null>();

  /**
   * Observable stream of modal configurations
   * Components can subscribe to this to react to modal state changes
   */
  modal$ = this.modalSubject.asObservable();

  /**
   * Shows a modal with the provided configuration
   * Automatically hides the modal after 3 seconds
   * @param {ModalConfig} config - The configuration for the modal to be displayed
   */
  showModal(config: ModalConfig): void {
    this.modalSubject.next(config);
    // Auto hide after 3 seconds
    setTimeout(() => {
      this.hideModal();
    }, 3000);
  }

  /**
   * Hides the currently displayed modal
   * Emits null to clear the modal state
   */
  hideModal(): void {
    this.modalSubject.next(null);
  }
}

/**
 * Service responsible for managing the application's theme (dark/light mode).
 * Uses BehaviorSubject to maintain and broadcast theme state changes across the application.
 */
import { Injectable } from '@angular/core';
import { BehaviorSubject } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class ThemeService {
  /** BehaviorSubject to track the current theme state */
  private isDarkMode = new BehaviorSubject<boolean>(false);

  /** Observable to allow components to subscribe to theme changes */
  isDarkMode$ = this.isDarkMode.asObservable();

  /**
   * Initializes the theme service by:
   * 1. Checking local storage for saved theme preference
   * 2. If no saved preference, checks system's color scheme preference
   * 3. Applies the determined theme
   */
  constructor() {
    // Check local storage for saved theme preference
    const savedTheme = localStorage.getItem('theme');
    if (savedTheme) {
      this.isDarkMode.next(savedTheme === 'dark');
      this.applyTheme(savedTheme === 'dark');
    } else {
      // Check system preference
      const prefersDark = window.matchMedia('(prefers-color-scheme: dark)').matches;
      this.isDarkMode.next(prefersDark);
      this.applyTheme(prefersDark);
    }
  }

  /**
   * Toggles between dark and light theme
   * Updates the theme state, applies the new theme, and saves preference to local storage
   */
  toggleTheme(): void {
    const newTheme = !this.isDarkMode.value;
    this.isDarkMode.next(newTheme);
    this.applyTheme(newTheme);
    localStorage.setItem('theme', newTheme ? 'dark' : 'light');
  }

  /**
   * Applies the theme by toggling CSS classes on the document body
   * @param isDark - Boolean indicating whether to apply dark theme
   */
  private applyTheme(isDark: boolean): void {
    document.body.classList.toggle('dark-theme', isDark);
    document.body.classList.toggle('light-theme', !isDark);
  }
}

