 */
export interface UserSession {
  /** Unique identifier for the user */
  userId: string;
  /** Username of the logged-in user */
  username: string;
  /** User's role in the system - either 'user' or 'admin' */
  role: 'user' | 'admin';
  /** Timestamp when the user account was created */
  createdAt: string;
  /** Timestamp of the user's most recent login */
  lastLogin: string;
}

/**
 * Interface representing the response from a login attempt
 */
export interface LoginResponse {
  /** Indicates whether the login attempt was successful */
  success: boolean;
  /** Message describing the result of the login attempt */
  message: string;
  /** User session information if login was successful */
  user: UserSession;
}

/**
 * Interface representing an error that occurred during login
 */
export interface LoginError {
  /** Error message describing what went wrong */
  message: string;
  /** HTTP status code associated with the error */
  statusCode: number;
}

/**
 * Login Component
 * Handles user authentication and login functionality
 */
import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { animate, style, transition, trigger } from '@angular/animations';

import { LoginError } from './login.interface';
import { LoginService } from './login.service';
import { ModalService } from '../shared/services/modal.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.scss'],
  // Animation configuration for fade in/out effects
  animations: [
    trigger('fadeInOut', [
      transition(':enter', [
        style({ opacity: 0, transform: 'translateY(-20px)' }),
        animate('300ms ease-out', style({ opacity: 1, transform: 'translateY(0)' }))
      ]),
      transition(':leave', [
        animate('300ms ease-in', style({ opacity: 0, transform: 'translateY(-20px)' }))
      ])
    ])
  ]
})
export class LoginComponent implements OnInit {
  /** Form group for login credentials */
  loginForm: FormGroup;
  /** Error message to display to user */
  errorMessage: string = '';
  /** Loading state indicator */
  isLoading: boolean = false;

  /**
   * Constructor initializes required services and form
   * @param formBuilder - Service for building reactive forms
   * @param loginService - Service handling authentication
   * @param router - Service for navigation
   * @param modalService - Service for displaying modal messages
   */
  constructor(
    private formBuilder: FormBuilder,
    private loginService: LoginService,
    private router: Router,
    private modalService: ModalService
  ) {
    // Initialize login form with validation
    this.loginForm = this.formBuilder.group({
      username: ['', [Validators.required, Validators.minLength(3)]],
      password: ['', [Validators.required, Validators.minLength(8)]]
    });
  }

  /**
   * Lifecycle hook that checks if user is already logged in
   */
  ngOnInit(): void {
    if (this.loginService.isLoggedIn()) {
      this.router.navigate(['/dashboard']);
    }
  }

  /**
   * Handles form submission
   * Validates form and attempts login if valid
   */
  onSubmit(): void {
    if (this.loginForm.valid) {
      this.isLoading = true;
      this.errorMessage = '';

      this.loginService.login(this.loginForm.value).subscribe({
        next: (response) => {
          if (response.success) {
            const { role } = response.user;
            this.modalService.showModal({
              type: 'success',
              message: 'Login successful! Redirecting...'
            });

            // Add animation delay before navigation
            setTimeout(() => {
              // Redirect based on user role
              if (role === 'admin') {
                this.router.navigate(['/admin/dashboard']);
              } else {
                this.router.navigate(['/user/dashboard']);
              }
            }, 800);
          }
        },
        error: (error: LoginError) => {
          this.modalService.showModal({
            type: 'error',
            message: error.message
          });
          this.isLoading = false;
        },
        complete: () => {
          this.isLoading = false;
        }
      });
    } else {
      this.markFormGroupTouched(this.loginForm);
    }
  }

  /**
   * Recursively marks all controls in a form group as touched
   * @param formGroup - The form group to mark as touched
   */
  private markFormGroupTouched(formGroup: FormGroup): void {
    Object.values(formGroup.controls).forEach(control => {
      control.markAsTouched();
      if (control instanceof FormGroup) {
        this.markFormGroupTouched(control);
      }
    });
  }

  /**
   * Gets error message for form control
   * @param controlName - Name of the form control
   * @returns Error message string
   */
  getErrorMessage(controlName: string): string {
    const control = this.loginForm.get(controlName);
    if (control?.errors) {
      if (control.errors['required']) {
        return `${controlName.charAt(0).toUpperCase() + controlName.slice(1)} is required`;
      }
      if (control.errors['minlength']) {
        return `${controlName.charAt(0).toUpperCase() + controlName.slice(1)} must be at least ${control.errors['minlength'].requiredLength} characters`;
      }
    }
    return '';
  }
}

/**
 * Authentication Guard for route protection in Angular application.
 * This guard implements CanActivate interface to control access to routes based on user authentication and role.
 */
@Injectable({
  providedIn: 'root'
})
export class AuthGuard implements CanActivate {
  /**
   * Constructor for AuthGuard
   * @param router - Angular Router service for navigation
   * @param loginService - Service handling user authentication
   */
  constructor(
    private router: Router,
    private loginService: LoginService
  ) {}

  /**
   * Determines if a route can be activated based on user authentication and role requirements
   * @param route - The route being accessed
   * @returns boolean - true if access is allowed, false otherwise
   */
  canActivate(route: ActivatedRouteSnapshot): boolean {
    // Get current user from login service
    const user = this.loginService.getCurrentUser();

    // If no user is logged in, redirect to login page
    if (!user) {
      this.router.navigate(['/login']);
      return false;
    }

    // Check if route requires specific role
    const requiredRole = route.data['role'] as string;
    if (requiredRole && user.role !== requiredRole) {
      // Redirect to appropriate dashboard based on user's role
      this.router.navigate([user.role === 'admin' ? '/admin/dashboard' : '/user/dashboard']);
      return false;
    }

    // Allow access if all checks pass
    return true;
  }
}

import { RouterModule, Routes } from '@angular/router';
import { AuthGuard } from './guards/auth.guard';
import { DashboardComponent } from './dashboard/dashboard.component';
import { LoginComponent } from './login/login.component';
import { NgModule } from '@angular/core';
import { SignupComponent } from './signup/signup.component';

/**
 * Application routing configuration
 * Defines the mapping between URLs and components
 */
const routes: Routes = [
  // Route for the login page
  { path: 'login', component: LoginComponent },

  // Route for the signup page
  { path: 'signup', component: SignupComponent },

  // Admin dashboard route with authentication and role-based access
  { 
    path: 'admin/dashboard', 
    component: DashboardComponent,
    canActivate: [AuthGuard],  // Protects route with authentication guard
    data: { role: 'admin' }    // Specifies admin role requirement
  },

  // User dashboard route with authentication and role-based access
  { 
    path: 'user/dashboard', 
    component: DashboardComponent,
    canActivate: [AuthGuard],  // Protects route with authentication guard
    data: { role: 'user' }     // Specifies user role requirement
  },

  // Default route redirect to login
  { path: '', redirectTo: '/login', pathMatch: 'full' },

  // Wildcard route for undefined paths, redirects to login
  { path: '**', redirectTo: '/login' }
];

/**
 * AppRoutingModule
 * 
 * Angular module that handles the application's routing configuration
 * Imports RouterModule with the defined routes
 * Exports RouterModule for use in other parts of the application
 */
@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }

